      "date": "1793-08-08",
      "tags_section": "",
      "text": "16. Bey Hrn. Rudolf Rornberger an der Huth-gass ist erste gutter Johannis-Zucker in kauer-nen Pfund-Büchsen à 10 Batzen, wie auch guter St. Vincent à 3 Bg. zu haben."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "17. Wo gutter Art grünte Bohnen zum Essen, und kleine weisse alte um Kochen in billigem Preis zu haben sind, um Berichthaus ohne Ent-geldt zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "18. Zwey Barellein oder Pressfass-Huth, wie auch ein ganz neuer Couloir-Huth, mittelmässiger Grösse, im Berichthaus zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "19. Bey Hrn. Burkhardt um Riesen sind extra neue grosse Jtalienische Kastandien, grosse Merrtauben mit und ohne Schf, Joachims, dürre Mörelchen, seiner Etuven, alles in billigem Preis zu haben."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "20. Zwölf Sack neuer Walzen in billigem Preis, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "21. Bey Hrn. Jacob Grimm Buchbinder ist zu haben: Ein Kriegs-Atlas von 63 theils Land-karten, Städten, Pläns von Bataillen und Belagerungen des itzigen Kriegs. 2) Die Bibel auf einer Welt mit Einschluss einer ganz Durchlauchtigs Welt, à 3 Tschl mit Waaben. 4) Journal du Camp de Compiegne avec fi-gures."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "22. Zwey saubere französische Pelzer in ein Wiethes-Haus auf des Land über zu ein Jahr daselbst abendzeitlich im Berichthaus zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "23. Eine Ordananz in der Aeckemer Vorstadt mit 4 Stuben, 4 Kümmern einer sehr scho-nen Werkstatt, Elistig und einem schönen ge-wölbten Keller und Garten, wegshalb sich bey Hrn. Jakob Maslin um Eisgass anzu-melden."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "24. Ein Freund, welcher etwa 600 Golder Hanf-Saamen anderer lebsten konnte, möchte aber solchen vorhero verkauft wissen, offeriret solbi-gen Hasten in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "25. Wo guter alter weisser Wien zu haben, ist bey alles Burges Hütte dem Riesen zu er-kundigen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "26. Circa 6. Saum erster alter und zur farber Höisemer-Win, gut als Neuenburger oder Burgunder, in billigem Preis, im Berichts-haus zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "27. Zwey Stücklein weissen Welin von 1760, à 8 Pfund im untern, und 4 Saum im an-dern, und à 8 Pfund im andern, weswegen nach Belieben zu haben, im Berichthaus ohne Entgeldt zu er-fragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "28. Ein Stock Serl ab 3 Saanen Watten vorm Rheinante, oder oberhalb der Schorenbruck, kleines Stücklein von 17 Saumen rostess Bölliger-Wein von 1760, schön reifs und lauter zu sim Berichtshauß ohne Entgeldt zu erfra-gen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "29. Auf 6. 8. Kunst zum Bären sind wiederum neue Saure-Ruben in billigem Preis zu haben."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "30. Ein roth Schaarlachen Camifol und Hosen in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "31. Im Oldenburger, Hof ist wohfvernächtens Baur zu haben."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "32. Ein Brauntöchslein bey der Steinen-Mühlin mit aller Reinlichkeit, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "33. Ein menne rother und weisser Burgunder, wie auch Muscat-Wein, Piccareeis wegen Rhein-Mieger um geringer Preis, daselbst 34 36er Mogarger-Wein in billigem Preis zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "34. Feine beiersische Hamburger-Strick-Wollen von 1 à 3 Pfund, wo dieselbe graumweis zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "35. Zwey Fässlein des Stegises Rehäußling im Spieg-Säuslein mit 4 Studen, 3 Kammern zc. ist entweder zu verkauffen, oder samstags zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "36. Weiss und rothe Mogarger, Wäline von 1762, wovon in billigem Preis nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "37. Ein Mannsbild in St. Peters Kirch auf dem Freuz, Hon ein grün Tombeav-Vesslein mit grünen wollenen unbängen, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "38. Ein Hausschslein mit einem schönen Bild und zugehöret in billigem Preis, im Berichts-haus zu erfragen."
    },
    {
      "date": "1793-08-08",
      "tags_section": "",
      "text": "39. Der Bärenkeller-hof in St. Peter, mit Garten, Stallung, Keller zc. wie der Anzei-gschein zeigen wird. Zu Ermanglung eines Käufers"
    }
  ]
}
